import './App.css';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import Study from 'Study.js'; // Assuming you have a Study component
import Button from './components/Button';

function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <h1 className="home-title">Orphedy</h1>
          <p className="home-caption">study with the one and only: Orpheus</p>
          <Button variant="primary" onClick={() => window.location.href = '/study'}>
            let's study
          </Button>
        </header>
      </div>
      <Route path="/study" component={Study} />
    </Router>
  );
}

export default App;
